import classes from "./ForSale.module.css";
import products from "./Products";

let ForSale = () => {
  let innerHTML = [];
  for (let i = 0; i < products.length; i++) {
    innerHTML.push(
      <div class="card">
        <div class="images">
          <h2 class="product-name">${products[i].name}</h2>
          <img
            class="large-photo"
            src="${products[i].img_url1}"
            alt="${products[i].name}"
          ></img>
        </div>
        <div className="small-photo">
          <img
            class="product_sm"
            src="${products[i].img_url3}"
            alt="${products[i].name}"
          />
          <img
            class="product_sm"
            src="${products[i].img_url4}"
            alt="${products[i].name}"
          />
        </div>
        <div class="text">
          <h3 class="price">${products[i].price}</h3>
          <h4 class="used">${products[i].used}</h4>
          <h4 class="description">${products[i].description}</h4>
        </div>
        <div class="email">
          <h4>
            <a href="mailto:jogucareers@gmail.com">
              email me about this product
            </a>
          </h4>
        </div>
      </div>
    );
  }
  return innerHTML;
};

export default ForSale;

